import React, { useEffect, useState } from 'react';

const ESTADOS = [
  { key: 'Disponible', label: 'Disponible', color: 'bg-orange-500' },
  { key: 'Charging', label: 'Cargando', color: 'bg-orange-600' },
  { key: 'Fuera', label: 'Fuera de servicio', color: 'bg-orange-700' },
];

// Función para mapear los estados del backend a categorías visuales
function mapEstado(estado) {
  if (!estado) return 'Fuera';
  if (estado === 'Charging') return 'Charging';
  if ([ 'Disponible', 'Available', 'Ready' ].includes(estado)) return 'Disponible';
  // Otros posibles estados de fuera de servicio
  if ([ 'Fuera de servicio', 'Error', 'Offline', 'Desconocido', 'Out of Service' ].includes(estado)) return 'Fuera';
  return 'Fuera';
}

export default function FastChargersDashboard() {
  const [cargadores, setCargadores] = useState([]);
  const [estadoSeleccionado, setEstadoSeleccionado] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    async function fetchData() {
      setLoading(true);
      setError(null);
      try {
        const res = await fetch(process.env.REACT_APP_API_URL + '/api/fast-chargers/status');
        const data = await res.json();
        setCargadores(data.chargers || []);
      } catch (err) {
        setError('Error al cargar el estado de los cargadores rápidos');
      } finally {
        setLoading(false);
      }
    }
    fetchData();
  }, []);

  // Agrupa cargadores por estado visual
  const agrupados = cargadores.reduce((acc, cargador) => {
    const grupo = mapEstado(cargador.estado);
    if (!acc[grupo]) acc[grupo] = [];
    acc[grupo].push(cargador);
    return acc;
  }, {});

  return (
    <div className="max-w-3xl mx-auto py-8">
      <h2 className="text-2xl font-bold mb-6 text-center">Cargadores rápidos - Estado actual</h2>
      <div className="flex flex-col md:flex-row gap-4 justify-center mb-8">
        {ESTADOS.map(({ key, label, color }) => (
          <button
            key={key}
            className={`flex-1 rounded-lg shadow p-6 text-white text-center font-semibold text-lg transition transform hover:scale-105 focus:outline-none ${color} ${estadoSeleccionado === key ? 'ring-4 ring-orange-300' : ''}`}
            onClick={() => setEstadoSeleccionado(key)}
          >
            <div className="text-4xl mb-2">{agrupados[key]?.length || 0}</div>
            <div>{label}</div>
          </button>
        ))}
      </div>
      {loading && <div className="text-center text-gray-500">Cargando...</div>}
      {error && <div className="text-center text-red-500">{error}</div>}
      {estadoSeleccionado && (
        <div className="mt-6">
          <h3 className="text-xl font-bold mb-4 text-orange-600 text-center">
            {ESTADOS.find(e => e.key === estadoSeleccionado)?.label} ({agrupados[estadoSeleccionado]?.length || 0})
          </h3>
          <div className="overflow-x-auto">
            <table className="min-w-full bg-white rounded shadow text-sm">
              <thead>
                <tr className="bg-orange-100">
                  <th className="px-3 py-2">Nombre</th>
                  <th className="px-3 py-2">ID</th>
                  <th className="px-3 py-2">Tipo</th>
                  <th className="px-3 py-2">Potencia</th>
                  <th className="px-3 py-2">Estado</th>
                </tr>
              </thead>
              <tbody>
                {(agrupados[estadoSeleccionado] || []).map((c, idx) => (
                  <tr key={c.connector_id + idx} className="border-b last:border-0">
                    <td className="px-3 py-2 font-medium">{c.charger_name}</td>
                    <td className="px-3 py-2">{c.connector_id}</td>
                    <td className="px-3 py-2">{c.connector_type}</td>
                    <td className="px-3 py-2">{c.power} kW</td>
                    <td className="px-3 py-2">{c.estado}</td>
                  </tr>
                ))}
                {(!agrupados[estadoSeleccionado] || agrupados[estadoSeleccionado].length === 0) && (
                  <tr><td colSpan={5} className="text-center py-4 text-gray-400">No hay cargadores en este estado.</td></tr>
                )}
              </tbody>
            </table>
          </div>
        </div>
      )}
    </div>
  );
}
